import React from 'react';

const AboutUs = () => {
  return (
    <div
      className="mx-auto grid place-items-center px-6 md:px-20 xxl:px-0"
      style={{ maxWidth: '1550px' }}>
      <div>
        <h3 className="mt-20 text-center text-2xl xl:text-4xl font-semibold uppercase leading-loose pb-3">
          smooth skin is just
          <br />a sugar away
        </h3>
      </div>
    </div>
  );
};

export default AboutUs;
